export default class PrepBlog extends Component {
render(){
  return(
      <div className ="popUp">
      <div className ="Imagepop">
          <button className='ClosingImage' onClick={this.props.ClosePop}
          >
              X
          </button>
   
  </div>
  </div>

  );
}
}
